class App extends Component() {

  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      memes: []
    };
  }

  componentDidMount() {
    fetch('http://localhost:2000')
      .then(response => response.json())
      .then(console.log);
  }

  render() {
    return (
      <div className="">
          <Form />
          <Image />

      </div> 
    );
  }
}


export default App;
